import React from 'react';
import './Logo.css'; // Importer le fichier CSS pour le style du logo

function Logo() {
  return (
    <div className="logo-container">
      <img src="/logo.svg" alt="Logo" className="logo-image" />
    </div>
  );
}

export default Logo;
